import React from "react";
import useFetchData from "../hooks/useFetchData";
import "./styles/OverallLanguageRank.css";

const OverallLanguageRank = ({ data }) => {
  const sortedData = [...data].sort((a, b) => b.trend_score - a.trend_score);

  return (
    <div className="overall-rank-container">
      <h3>전체 언어 순위</h3>
      <ul>
        {sortedData.slice(0, 5).map((item, index) => (
          <li key={item.language}>
            {index + 1}. {item.language}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default OverallLanguageRank;
